description:
Bandslam (2009)  

Verenigde Staten
Drama / Muziek
111 minuten

geregisseerd door Todd Graff
met Alyson Michalka, Vanessa Hudgens en Gaelan Connell

Tiener Will ligt niet lekker in de groep en is op zijn school een buitenbeentje. Dan leert hij een populair meisje beter kennen en blijken ze dezelfde passie te hebben: muziek. Samen met enkele anderen besluiten ze een rockband te vormen en beginnen met oefenen voor een aankomende wedstrijd.

